import React from "react";
import Footer from "../UI/Footer";
import Navbarr from "../UI/Navbar";
import "./Home.module.css";
function Home() {
  return (
    <>
      <Navbarr />
      <div className="container p-5">
        <h2>Homepage</h2>
      </div>
      <Footer />
    </>
  );
}

export default Home;
